@acidmanNFT @Worldwide_WEB3 It means you create them as images, which we use to link to the original NFT ID.

They're not new NFTs.
They're additional utility for all and any to use.

@DeliTheThracian You will be able to enter an area of the game where you can challenge other players to fight you.

You both wager your NFT avatar in the fight. 

The winner takes all.
